export const TodoList = ({ todos }) => {
  return (
    <>
      <h2>Состояние компонента</h2>
      <ul>
        {todos.map(({ id, text, completed }) => (
          <li key={id}>
            <p>{text}</p>
            <button>Удалить</button>
          </li>
        ))}
      </ul>
    </>
  );
};
